INSERT INTO `ads` VALUES (6,'SV SCHOOLS','A school is an institution designed for the teaching of students (or \"pupils\") under the direction of teachers. Most countries have systems of formal education, which is commonly compulsory.[citation needed] In these systems, students progress through a series of schools. The names for these schools vary by country (discussed in the Regional section below), but generally include primary school for young children and secondary school for teenagers who have completed primary education. An institution where higher education is taught, is commonly called a university college or university.\r\n',NULL,'3-23/121 ','VISHAKHA STEELS','MEHDIPATNAM','Hyderabad Urban','Andhra Pradesh','India','bschools','SRI VENKATESWHARA SCHOOLS','SATHISH BHARADVAJ 9000123654','sathish.bharadvaj@gmail.com',2,2,1,1,'2013-08-18 03:49:37','2013-08-18 03:52:16','6.jpg','image/jpeg',137964,'2013-08-18 03:49:34','3.jpg','image/jpeg',14137,'2013-08-18 03:49:36','2.jpg','image/jpeg',166965,'2013-08-18 03:49:37','OTHER ADDS','OTHER ADDS','OTHER ADDS','OTHER ADDS','OTHER ADDS'),(7,'NARENDRA SCHOOLS','A school is an institution designed for the teaching of students (or \"pupils\") under the direction of teachers. Most countries have systems of formal education, which is commonly compulsory.[citation needed] In these systems, students progress through a series of schools. The names for these schools vary by country (discussed in the Regional section below), but generally include primary school for young children and secondary school for teenagers who have completed primary education. An institution where higher education is taught, is commonly called a university college or university. ',NULL,'23-4/33-A','SARASWHATHI NAGAR','MEHDIPATNAM','Cuddapah','Andhra Pradesh','India','bschools','NARENDRA HIGH SCHOOLS','SATHISH BHARADVAJ 9000123654','sathish.bharadvaj@gmail.com',2,1,1,3,'2013-08-18 04:11:00','2013-08-18 04:11:00','2.jpg','image/jpeg',166965,'2013-08-18 04:1